export default function WalletsList(props){

  const displayWallets = (props) => {
    const {wallets} = props;
    if (wallets.length > 0){
      return(
        wallets.map((wallet) => {
          console.log(wallet.walletID);
          return(
            <div key={wallet.walletID}>
              <p>{wallet.walletName}</p>
            </div>
          )
        })
      )
    } else {
      return (<div>loading..</div>)
    }
  }

  return(
    <>
      {displayWallets(props)}
    </>
  )
};
